import React from 'react';

function TestApp() {
  console.log('TestApp rendered! Time:', new Date().toISOString());

  // Test if we can access window and document
  console.log('Window available:', typeof window !== 'undefined');
  console.log('Document available:', typeof document !== 'undefined');

  return (
    <div style={{
      minHeight: '100vh',
      background: 'linear-gradient(135deg, #ff6b6b, #4ecdc4)',
      display: 'flex',
      alignItems: 'center',
      justifyContent: 'center',
      flexDirection: 'column',
      gap: '2rem',
      padding: '2rem',
      fontFamily: 'Arial, sans-serif'
    }}>
      <h1 style={{ color: 'white', fontSize: '4rem', margin: 0, textShadow: '2px 2px 4px rgba(0,0,0,0.3)' }}>
        ðŸŽ‰ SUCCESS!
      </h1>
      <h2 style={{ color: 'white', fontSize: '2rem', margin: 0, textAlign: 'center', textShadow: '1px 1px 2px rgba(0,0,0,0.3)' }}>
        React is Working Perfectly!
      </h2>
      <p style={{ color: 'white', fontSize: '1.2rem', textAlign: 'center', maxWidth: '600px', textShadow: '1px 1px 2px rgba(0,0,0,0.3)' }}>
        âœ“ React components are rendering<br/>
        âœ“ CSS styles are working<br/>
        âœ“ JavaScript is executing<br/>
        âœ“ Environment variables are loading
      </p>

      <div style={{
        background: 'rgba(255,255,255,0.9)',
        padding: '2rem',
        borderRadius: '16px',
        boxShadow: '0 8px 32px rgba(0,0,0,0.2)',
        textAlign: 'center',
        maxWidth: '500px',
        width: '100%'
      }}>
        <h3 style={{ color: '#333', marginTop: 0 }}>Debug Information</h3>
        <div style={{ color: '#666', fontSize: '0.9rem', textAlign: 'left' }}>
          <strong>Timestamp:</strong> {new Date().toLocaleString()}<br/>
          <strong>Environment:</strong> {process.env.NODE_ENV}<br/>
          <strong>API URL:</strong> {process.env.REACT_APP_API_URL || 'not set'}<br/>
          <strong>Google Client ID:</strong> {process.env.REACT_APP_GOOGLE_CLIENT_ID ? 'set' : 'not set'}<br/>
        </div>
      </div>

      <button 
        onClick={() => {
          console.log('Button clicked! Time:', new Date().toISOString());
          alert('ðŸŽ‰ JavaScript is working perfectly!\n\nIf you see this alert, everything is functioning correctly.');
        }}
        style={{
          background: 'linear-gradient(135deg, #667eea 0%, #764ba2 100%)',
          color: 'white',
          border: 'none',
          borderRadius: '8px',
          padding: '1rem 2rem',
          fontSize: '1.1rem',
          fontWeight: 600,
          cursor: 'pointer',
          boxShadow: '0 4px 16px rgba(0,0,0,0.2)',
          transition: 'transform 0.2s ease'
        }}
        onMouseOver={(e) => e.target.style.transform = 'translateY(-2px)'}
        onMouseOut={(e) => e.target.style.transform = 'translateY(0)'}
      >
        ðŸš€ Test JavaScript
      </button>

      <div style={{
        background: 'rgba(255,255,255,0.1)',
        color: 'white',
        padding: '1rem',
        borderRadius: '8px',
        fontSize: '0.9rem',
        textAlign: 'center',
        border: '1px solid rgba(255,255,255,0.2)'
      }}>
        If this page loads correctly, the white screen issue is in the main App component.
      </div>
    </div>
  );
}

export default TestApp;
